import React from 'react';

const PageTitleSearch = () => {
    return (
        <section id="page-title">
            <div className="wrapper">
                <div className="title position-relative">
                    <h1 className="small">8 results for: <span className="line">The</span>
                    </h1>

                    <div className="title-clone">Search.</div>
                </div>
            </div>
        </section>
    );
};

export default PageTitleSearch;
